import { Paper, TextField, Typography } from "@material-ui/core";
import React from "react";
import useStyles from "./styles";

const Form = () => {
	const classes = useStyles();
	const handleSubmit = () => {};
	return (
		<Paper className={classes.paper}>
			<form
				autoComplete="off"
				noValidate
				className={classes.form}
				onSubmit={handleSubmit}
			>
				<Typography variant="h6">Createing a memories</Typography>
				<TextField
					name="creator"
					variant="outlined"
					label="Creator"
					fullWidth
				></TextField>
			</form>
		</Paper>
	);
};

export default Form;
